        public CommandManager commandManager;
        public Canvas canvas;
        public MouseState prevMouseState;
        public UInt32 pX, pY;
        KeyEvent Key;
        public string command = "";
        public string response;
        public int commandCursor = 0;
        public int currentWallpaper = 0;
        public bool mouseOnWallpaperMenuButton = false;

        public bool menuOn = false;
        public bool prevMenuOn = false;
        public bool mouseOnMenu = false;
        public bool prevMouseOnMenu = false;
        public Int32 currentActiveApplication = 0;

        public bool clockActive = false;
        public bool clockEnabled = false;
        public bool mouseOnClockIcon = false;
        public bool mouseOnClockMenuButton = false;
        public Int32 clockXpos = 300;
        public Int32 clockYpos = 300;
        public Int32 clockIconXpos = 40;
        public Int32 clockIconYpos = 0;

        public bool consoleActive = false;
        public bool consoleEnabled = false;
        public bool mouseOnConsoleIcon = false;
        public bool mouseOnConsoleMenuButton = false;
        public Int32 consoleXpos = 400;
        public Int32 consoleYpos = 400;
        public Int32 consoleIconXpos = 40;
        public Int32 consoleIconYpos = 0;

        public static String cursorImageString = "";
        public static String menuImageString = "";

        [ManifestResourceStream(ResourceName = "WindOS.Assets.Gamma Changed.Wallpaper030.bmp")] public static byte[] test_image;
        public static Bitmap imgbit = new Bitmap(test_image);//This is the test.bmp image loaded as bitmap

        Bitmap cursorImageBitmap = new Bitmap(Convert.FromBase64String(cursorImageString));
        Bitmap menuImageBitmap = new Bitmap(Convert.FromBase64String(menuImageString));
        Bitmap backgroundImagedefaultBitmap = new Bitmap(Convert.FromBase64String(BackgroundDefault.backgroundImagedefaultString));
        //Bitmap backgroundImage010Bitmap = new Bitmap(Convert.FromBase64String(Background010.backgroundImage010String));
        //Bitmap backgroundImage020Bitmap = new Bitmap(Convert.FromBase64String(Background020.backgroundImage020String));
