        void DelayInMS(int ms)
        {
            for (int i = 0; i < ms * 100000; i++)
            {
                ;
                ;
                ;
                ;
                ;
            }
        }

        protected override void BeforeRun()
        {
            this.VFS = new CosmosVFS();
            Sys.FileSystem.VFS.VFSManager.RegisterVFS(this.VFS);
            this.commandManager = new CommandManager();
            System.Console.Write(DateTime.Now);
            System.Console.Write(DateTime.Today);

            this.canvas = FullScreenCanvas.GetFullScreenCanvas(new Mode(1280, 720, ColorDepth.ColorDepth32));
            this.canvas.Clear(Color.AliceBlue);
            this.canvas.Display();

            MouseManager.ScreenHeight = (UInt32)canvas.Mode.Height;
            MouseManager.ScreenWidth = (UInt32)canvas.Mode.Width;
        }

        protected override void Run()
        {
            HandleGUIInputs();
            return;

            String response;
            System.Console.WriteLine("\n");
            String input = System.Console.ReadLine();
            response = this.commandManager.processInput(input);

            System.Console.WriteLine(response);
        }

        public void HandleGUIInputs()
        {
            if (pX != MouseManager.X || pY != MouseManager.Y || prevMouseState != MouseManager.MouseState)
            {
                if (!mouseOnMenu && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(0, 0, 40, 40))) && (MouseManager.MouseState == MouseState.Left))
                {
                    menuOn = !menuOn;
                    mouseOnMenu = true;
                }
                else if (!(new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(0, 0, 40, 40))))
                {
                    mouseOnMenu = false;
                }

                if (menuOn && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(10, 50, 190, 60))) && (MouseManager.MouseState == MouseState.Left))
                {
                    Cosmos.System.Power.Shutdown();
                }
                else if (menuOn && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(10, 120, 190, 60))) && (MouseManager.MouseState == MouseState.Left))
                {
                    Cosmos.System.Power.Reboot();
                }
                else if (menuOn && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(0, 190, 200, 60))) && (MouseManager.MouseState == MouseState.Left && !mouseOnClockMenuButton))
                {
                    clockActive = true;
                    clockEnabled = true;
                    mouseOnClockMenuButton = true;
                    currentActiveApplication = 1;
                }
                else if (menuOn && !(new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(0, 190, 200, 60))) && mouseOnClockMenuButton)
                {
                    mouseOnClockMenuButton = false;
                }
                else if (menuOn && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(0, 260, 200, 60))) && (MouseManager.MouseState == MouseState.Left && !mouseOnConsoleMenuButton))
                {
                    consoleActive = true;
                    consoleEnabled = true;
                    mouseOnConsoleMenuButton = true;
                    currentActiveApplication = 2;
                }
                else if (menuOn && !(new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(0, 260, 200, 60))) && mouseOnClockMenuButton)
                {
                    mouseOnConsoleMenuButton = false;
                }
                else if (menuOn && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(0, 330, 200, 60))) && (MouseManager.MouseState == MouseState.Left && !mouseOnWallpaperMenuButton))
                {
                    if (currentWallpaper == 5)
                        currentWallpaper = 0;
                    else
                        currentWallpaper++;
                    mouseOnWallpaperMenuButton = true;
                }
                else if (menuOn && !(new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(0, 330, 200, 60))) && mouseOnWallpaperMenuButton)
                {
                    mouseOnWallpaperMenuButton = false;
                }
            }


            DrawTabBar();

            switch (currentActiveApplication)
            {
                case 0:
                    if ((new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(clockXpos, clockYpos, 200, 200))))
                    {
                        currentActiveApplication = 1;
                    }
                    else if ((new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(consoleXpos, consoleYpos, 200, 200))))
                    {
                        currentActiveApplication = 1;
                    }
                    break;

                case 1:
                    if (consoleActive)
                        DrawConsole();
                    if (clockActive)
                        DrawClock();
                    HandleClockInputs();
                    break;

                case 2:
                    if (clockActive)
                        DrawClock();
                    if (consoleActive)
                        DrawConsole();
                    HandleConsoleInputs();
                   break;
            }

            DrawMenu();
            DrawMouse();
            this.canvas.Display();


            pX = MouseManager.X;
            pY = MouseManager.Y;
            prevMenuOn = menuOn;
            prevMouseOnMenu = mouseOnMenu;

            Heap.Collect();
        }

        public void DrawMouse()
        {
            this.canvas.DrawImageAlpha(cursorImageBitmap, (Int32)MouseManager.X, (Int32)MouseManager.Y);
        }

        public void DrawTabBar()
        {
            switch (currentWallpaper)
            {
                case 0:
                    this.canvas.DrawImage(backgroundImagedefaultBitmap, 0, 0);
                    break;
                case 1:
                    //this.canvas.DrawImage(backgroundImage010Bitmap, 0, 0);
                    break;
                case 2:
                    //this.canvas.DrawImage(backgroundImage020Bitmap, 0, 0);
                    break;
                case 3:
                    //this.canvas.DrawImage(backgroundImage030Bitmap, 0, 0);
                    break;
                case 4:
                    this.canvas.DrawImage(backgroundImage040Bitmap, 0, 0);
                    break;
                case 5:
                    //this.canvas.DrawImage(backgroundImage050Bitmap, 0, 0);
                    break;
                default:
                    break;
            }
            this.canvas.DrawImage(imgbit, 0, 0);
            this.canvas.DrawFilledRectangle(Color.OrangeRed, 0, 0, 40, 40);
            if (consoleEnabled)
                DrawConsoleIcon();
            if (clockEnabled)
                DrawClockIcon();
        }

        public void DrawMenu()
        {
            if (menuOn == true)
            {
                this.canvas.DrawImage(menuImageBitmap, 0, 40);
            }
        }

        public void DrawClock()
        {
            this.canvas.DrawFilledRectangle(Color.DarkGray, clockXpos, clockYpos, 200, 200);
            this.canvas.DrawFilledRectangle(Color.LightCoral, clockXpos, clockYpos, 180, 20);
            this.canvas.DrawFilledRectangle(Color.IndianRed, clockXpos + 180, clockYpos, 20, 20);
            this.canvas.DrawFilledRectangle(Color.GreenYellow, clockXpos + 160, clockYpos, 20, 20);
            this.canvas.DrawString(DateTime.Today.ToString(), PCScreenFont.Default, Color.AntiqueWhite, clockXpos + 50, clockYpos + 50);
            this.canvas.DrawString(TimeOnly.FromDateTime(DateTime.Now).ToString(), PCScreenFont.Default, Color.AntiqueWhite, clockXpos + 50, clockYpos + 75);
            this.canvas.DrawFilledRectangle(Color.DarkGray, clockXpos + 130, clockYpos + 50, 70, 30);
        }

        public void DrawClockIcon()
        {
            for (int i = 0; i < 10; i++)
            {
                if (this.canvas.GetPointColor(45 + (i * 40), 0) == Color.DeepSkyBlue)
                {
                    this.canvas.DrawFilledRectangle(Color.Green, 40 + (i * 40), 0, 40, 40);
                    clockIconXpos = 40 + (i * 40);
                    clockIconYpos = 0;
                    i = 100;
                }
            }
        }

        public void HandleClockInputs()
        {

            Int32 prevX = (Int32)MouseManager.X;
            Int32 prevY = (Int32)MouseManager.Y;

            if (clockEnabled && !menuOn && clockActive && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(clockXpos, clockYpos, 150, 20))) && (MouseManager.MouseState == MouseState.Left))
            {
                currentActiveApplication = 1;
            repositionClock:
                if (clockEnabled && !menuOn && clockActive && (MouseManager.MouseState == MouseState.Left))
                {
                    clockXpos = clockXpos + ((Int32)MouseManager.X - prevX);
                    clockYpos = clockYpos + ((Int32)MouseManager.Y - prevY);
                    prevX = (Int32)MouseManager.X;
                    prevY = (Int32)MouseManager.Y;
                    DrawTabBar();
                    if (consoleActive)
                        DrawConsole();
                    DrawClock();
                    DrawMouse();
                    this.canvas.Display();
                    Heap.Collect();
                    goto repositionClock;
                }
            }
            else if (clockEnabled && !menuOn && clockActive && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(clockXpos + 180, clockYpos, 20, 20))) && (MouseManager.MouseState == MouseState.Left))
            {
                clockActive = false;
                clockEnabled = false;
                if (consoleActive)
                    currentActiveApplication = 2;
                else
                    currentActiveApplication = 0;
            }
            else if (clockEnabled && !menuOn && clockActive && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(clockXpos + 160, clockYpos, 20, 20))) && (MouseManager.MouseState == MouseState.Left))
            {
                clockActive = false;
            }
            else if (!mouseOnClockIcon && !menuOn && clockEnabled && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(clockIconXpos, clockIconYpos, 40, 40))) && (MouseManager.MouseState == MouseState.Left))
            {
                clockActive = !clockActive;
                mouseOnClockIcon = true;
            }
            else if (!(new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(clockIconXpos, clockIconYpos, 40, 40))))
            {
                mouseOnClockIcon = false;
            }
            else if (!(new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(clockXpos, clockYpos, 200, 200))))
            {
                currentActiveApplication = 0;
            }
        }

        public void DrawConsole()
        {
            this.canvas.DrawFilledRectangle(Color.SpringGreen, consoleXpos, consoleYpos, 200, 200);
            this.canvas.DrawFilledRectangle(Color.LightCoral, consoleXpos, consoleYpos, 180, 20);
            this.canvas.DrawFilledRectangle(Color.IndianRed, consoleXpos + 180, consoleYpos, 20, 20);
            this.canvas.DrawFilledRectangle(Color.GreenYellow, consoleXpos + 160, consoleYpos, 20, 20);

            this.canvas.DrawString(command.ToString(), PCScreenFont.Default, Color.Brown, consoleXpos + 5, consoleYpos + 25);
        }

        public void HandleConsoleInputs()
        {
            if (KeyboardManager.TryReadKey(out Key))
            {
                if (Key.Key == ConsoleKeyEx.Enter || Key.Key == ConsoleKeyEx.NumEnter)
                {
                    command = "";
                    commandCursor = 0;
                }
                else if (Key.Key == ConsoleKeyEx.Backspace)
                {
                    int j = command.Length;
                    string buffer = command;
                    command = "";

                    for (int i = 0; i < (j - 1); i++)
                    {
                        command += buffer[i].ToString();
                    }
                }
                else
                {
                    command += Key.KeyChar.ToString();
                    commandCursor++;
                }
            }

            Int32 prevX = (Int32)MouseManager.X;
            Int32 prevY = (Int32)MouseManager.Y;

            if (consoleEnabled && !menuOn && consoleActive && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(consoleXpos, consoleYpos, 150, 20))) && (MouseManager.MouseState == MouseState.Left))
            {
                currentActiveApplication = 2;
            repositionConsole:
                if (consoleEnabled && !menuOn && consoleActive && (MouseManager.MouseState == MouseState.Left))
                {
                    consoleXpos = consoleXpos + ((Int32)MouseManager.X - prevX);
                    consoleYpos = consoleYpos + ((Int32)MouseManager.Y - prevY);
                    prevX = (Int32)MouseManager.X;
                    prevY = (Int32)MouseManager.Y;
                    DrawTabBar();
                    if (clockActive)
                        DrawClock();
                    DrawConsole();
                    DrawMouse();
                    this.canvas.Display();
                    Heap.Collect();
                    goto repositionConsole;
                }
            }
            else if (consoleEnabled && !menuOn && consoleActive && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(consoleXpos + 180, consoleYpos, 20, 20))) && (MouseManager.MouseState == MouseState.Left))
            {
                consoleActive = false;
                consoleEnabled = false;
                if (clockActive)
                    currentActiveApplication = 1;
                else
                    currentActiveApplication = 0;
            }
            else if (consoleEnabled && !menuOn && consoleActive && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(consoleXpos + 160, consoleYpos, 20, 20))) && (MouseManager.MouseState == MouseState.Left))
            {
                consoleActive = false;
            }
            else if (!mouseOnConsoleIcon && !menuOn && consoleEnabled && (new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(consoleIconXpos, consoleIconYpos, 40, 40))) && (MouseManager.MouseState == MouseState.Left))
            {
                consoleActive = !consoleActive;
                mouseOnConsoleIcon = true;
            }
            else if (!(new Rectangle((Int32)MouseManager.X, (Int32)MouseManager.Y, 1, 1).IntersectsWith(new Rectangle(consoleIconXpos, consoleIconYpos, 40, 40))))
            {
                mouseOnConsoleIcon = false;
            }
            }

        public void DrawConsoleIcon()
        {
            for (int i = 0; i < 10; i++)
            {
                if (this.canvas.GetPointColor(45 + (i * 40), 0) == Color.DeepSkyBlue)
                {
                    this.canvas.DrawFilledRectangle(Color.SpringGreen, 40 + (i * 40), 0, 40, 40);
                    consoleIconXpos = 40 + (i * 40);
                    consoleIconYpos = 0;
                    i = 100;
                }
            }
        }
